        static List<(int value, long encrypted, int originalIdx)> list =
            new List<(int value, long encrypted, int originalIdx)>();

        public static void Run()
        {
            list = args.Split("\r\n")
                .Select((x, idx) => (value: int.Parse(x), encrypted: long.Parse(x) * 811589153, originalIdx: idx))
                .ToList();

            Display();
            for (int j = 0; j < 10; j++)
            {
                Console.WriteLine($"\r\nROUND {j + 1}");
                for (int i = 0; i < list.Count; i++)
                {
                    InsterElem(i);
                    Display();
                }
            }

            var zero = list.Single(x => x.value == 0);
            var zeroIdx = list.IndexOf(zero);
            var thousand = list.ElementAt((zeroIdx + 1000) % list.Count);
            var _2thousand = list.ElementAt((zeroIdx + 2000) % list.Count);
            var _3thousand = list.ElementAt((zeroIdx + 3000) % list.Count);

            Console.WriteLine($"\r\nzeroIdx: {zeroIdx}");
            Console.WriteLine($"1000 value: {thousand.encrypted}");
            Console.WriteLine($"2000 value: {_2thousand.encrypted}");
            Console.WriteLine($"3000 value: {_3thousand.encrypted}");
            Console.WriteLine(thousand.encrypted + _2thousand.encrypted + _3thousand.encrypted);
        }

        static void InsterElem(int originalIdx)
        {
            var elem = list.Single(x => x.Item3 == originalIdx);
            var oldIndex = list.IndexOf(elem);

            var newIndex = oldIndex + elem.Item2;
            var howMany = (int)(newIndex / list.Count);
            var newIndexInt = (int)(newIndex % list.Count) + howMany;

            list.RemoveAt(oldIndex);
            Insert(elem, newIndexInt);
        }

        static void Insert((int, long, int) elem, int newIndexInt)
        {
            if (newIndexInt > list.Count || newIndexInt < -list.Count)
            {
                var howMany = newIndexInt / list.Count;
                newIndexInt = (newIndexInt % list.Count);
                Insert(elem, newIndexInt);
            }
            else if (newIndexInt < 0)
            {
                list.Insert(list.Count + newIndexInt, elem);
            }
            else if (newIndexInt == 0 || newIndexInt == list.Count)
            {
                list.Add(elem);
            }
            else
            {
                list.Insert(newIndexInt, elem);
            }
        }

        static void Display()
        {
            return;
            Console.WriteLine(string.Join(", ", list.Select(x => x.Item2)));
        }
